import React, { Component } from "react";
import c from "../notes/c3/c.wav";
import d from "../notes/c3/d.wav";
import e from "../notes/c3/e.wav";
import f from "../notes/c3/f.wav";
import g from "../notes/c3/g.wav";
import a from "../notes/c3/a.wav";
import b from "../notes/c3/b.wav";

class GuessTheNote extends Component {
  render() {
    const playSound = note => {
      const audio = new Audio(note);
      audio.play();
    };

    const notes = [
      { name: "C", sound: c },
      { name: "D", sound: d },
      { name: "E", sound: e },
      { name: "F", sound: f },
      { name: "G", sound: g },
      { name: "A", sound: a },
      { name: "B", sound: b }
    ].map(note => {
      return (
        <button onClick={() => playSound(note.sound)}> {note.name} </button>
      );
    });

    return <div className="guessTheNote">{notes}</div>;
  }
}

export default GuessTheNote;
